function App() {
  return (
    <div className="App">
      <header>
        <h1>My Resume</h1>
      </header>

      <section className="main-content">
        <AboutMe />

        <Education />

        <Skills />

        <div className="contact">
          <h3>Contact</h3>
          <p>GitHub: <a href="https://github.com/johndoe" target="_blank" rel="noopener noreferrer">johndoe</a></p>
        </div>
      </section>
    </div>
  );
}

export default App;
